import React, { useState, useEffect } from 'react';
import '../../styles/Realtor/GeneratedLeads.css';

const GeneratedLeads = () => {
  const [leads, setLeads] = useState({
    sellers: [],
    buyers: []
  });

  const getLeads = async () => {
    try {
      // Get seller leads
      const sellerResponse = await fetch("https://realtoriqbackend.onrender.com/getSellerData", {
        credentials: 'include',
      });

      // Get buyer leads (assuming you have a similar endpoint)
      const buyerResponse = await fetch("https://realtoriqbackend.onrender.com/getBuyerData", {
        credentials: 'include',
      });

      if (sellerResponse.ok) {
        const sellerData = await sellerResponse.json();
        setLeads(prev => ({
          ...prev,
          sellers: Array.isArray(sellerData) ? sellerData : [sellerData]
        }));
      }

      if (buyerResponse.ok) {
        const buyerData = await buyerResponse.json();
        setLeads(prev => ({
          ...prev,
          buyers: Array.isArray(buyerData) ? buyerData : [buyerData]
        }));
      }
    } catch (error) {
      console.error("Error fetching leads:", error);
    }
  };

  useEffect(() => {
    getLeads();
    const intervalId = setInterval(getLeads, 5000);
    return () => clearInterval(intervalId);
  }, []);

  const LeadCard = ({ lead, type }) => (
    <div className="lead-card">
      <div className="lead-header">
        <span className={`lead-type ${type}`}>{type}</span>
        <span className="lead-date">{new Date().toLocaleDateString()}</span>
      </div>
      <div className="lead-info">
        <h3>{lead.LeadName}</h3>
        <div className="lead-details">
          <p><i className="fas fa-phone"></i> {lead.Contact}</p>
          <p><i className="fas fa-envelope"></i> {lead.Email}</p>
          {type === 'seller' ? (
            <p><i className="fas fa-tag"></i> Asking: ${lead.AskingPrice}</p>
          ) : (
            <p><i className="fas fa-wallet"></i> Budget: ${lead.Budget}</p>
          )}
        </div>
      </div>
    </div>
  );

  return (
    <section className="generated-leads">
      <div className="leads-header">
        <h2>Generated Leads</h2>
        <p>Recent client inquiries from your form</p>
      </div>

      <div className="leads-grid">
        <div className="leads-column">
          <div className="leads-section-header">
            <h3>Seller Leads</h3>
            <span className="lead-count">{leads.sellers.length} leads</span>
          </div>
          <div className="leads-list">
            {leads.sellers.length > 0 ? (
              leads.sellers.map((lead, index) => (
                <LeadCard key={index} lead={lead} type="seller" />
              ))
            ) : (
              <div className="no-leads">No seller leads yet</div>
            )}
          </div>
        </div>

        <div className="leads-column">
          <div className="leads-section-header">
            <h3>Buyer Leads</h3>
            <span className="lead-count">{leads.buyers.length} leads</span>
          </div>
          <div className="leads-list">
            {leads.buyers.length > 0 ? (
              leads.buyers.map((lead, index) => (
                <LeadCard key={index} lead={lead} type="buyer" />
              ))
            ) : (
              <div className="no-leads">No buyer leads yet</div>
            )}
          </div>
        </div>
      </div>
    </section>
  );
};

export default GeneratedLeads;
